import React from 'react';
import './LaunchingSoon.scss';
import { Parallax, ParallaxProvider } from 'react-scroll-parallax';

const LaunchingSoon = () => {
  return (
    <div className="launchingSoon">
        <ParallaxProvider>
            <Parallax speed={-10}>
                <h1>
                    MillionDollarPosters
                </h1>
            </Parallax>
        </ParallaxProvider>
    </div>
  )
}

export default LaunchingSoon
